import React, { useState }  from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

const Home = () => {
    const [members, setMembers] = useState([]);
    const [showTable, setShowTable] = useState(false);

    async function handleButtonClick() {
      fetch('http://localhost:8082/members')
        .then(response => response.json())
        .then(data => setMembers(data))
        .catch(error => console.error(error));

      setShowTable(true);
    }
  // return (
  //   <div>
  //     <h1>Welcome Admin</h1>
  //     <p>View information about our gym and memberships available, and class schedules.</p>
  //     <nav>
  //       <ul>
  //         <li><Link to="/login">List Classs</Link></li>
  //         <li><Link to="/register">Register</Link></li>
  //       </ul>
  //     </nav>
  //   </div>

  return (
    <div>
      <button onClick={handleButtonClick}>Show Members</button>
      {showTable && (
        <table>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
              <th>Membership Start Date</th>
              <th>Membership End Date</th>
            </tr>
          </thead>
          <tbody>
            {members.map(member => (
              <tr key={member._id}>
                <td>{member.name}</td>
                <td>{member.email}</td>
                <td>{member.phone}</td>
                <td>{member.membership_start_date}</td>
                <td>{member.membership_end_date}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
}

export default Home;
